    true,nt"url": null,nt"notes": "<p>On February 8, 2006, the President signed
    the Deficit Reduction Act (DRA) of 2005. Section 5001(c) of DRA requires the Secretary
    to identify conditions that are, (a) high cost or high volume or both, (b) result
    in the assignment of a case to a DRG that has a higher payment when present as a
    secondary diagnosis, and (c) could reasonably have been prevented through the application
    of evidence-based guidelines. Section 5001(c) provides that CMS can revise the list
    of conditions from time to time, as long as it contains at least two conditions.</p>n",nt"license_title":
